import React from 'react'
export const AccordionOthersDS=()=>{
    return{       
        AccordionHeadline : "General questions",
        AccTab1:{
                tabHeading:"Who should attend Microsoft Ignite?",
                tabContent:"Microsoft Ignite is for anyone who is motivated to be on the frontier of innovation and tech. We recognize that the role of IT has shifted considerably, as has the way IT decisions are made. Therefore, our keynotes and sessions are meant for all roles, from developers and IT implementers to those who make large-scale purchasing decisions for enterprise tech and security solutions.",
                currentState:"collapse"             
        } ,
        AccTab2:{
            tabHeading:"What is on the agenda?",
            tabContent:"The initial 2020 agenda will be posted on the Microsoft Ignite website. Please check back for the most up-to-date information.",
            currentState:"collapse"             
        },
        AccTab3:{
            tabHeading:"How can I learn about sponsor and exhibitor opportunities?",
            tabContent:"To learn more about sponsor opportunities, visit the Microsoft Sponsor Program website.",
            currentState:"collapse"             
        },
        AccTab4:{
            tabHeading:"Where can I access session information and hands-on labs from 2019? ",
            tabContent:"Visit our Microsoft Ignite 2019 on-demand sessions page to access sessions and hands-on labs from Microsoft Ignite 2019. Please note that while most sessions are posted, a small number are not. Microsoft Ignite videos are available for up to one year after the event or while the content is still relevant. Labs are also posted on our hands-on labs page.",
            currentState:"collapse"             
        }
    }
}
